        type: string
actions:
  - name: Normal_Search
    description: Run query
    parameters:
    - name: search_term
      description: search term - e.g. example.com or john@example.com
      required: true
      example: "abx@xyz.com"
      schema:
        type: string 
    - name: date
      description: Date
      example: "YYYYMMDD"
      required: false
      schema:
        type: string
  - name: Domain_Checker
    description: Run check_domain query
    parameters:
    - name: Imp_domain
      description: enter domain you received in mail
      example: "example.com"
      required: true
      schema:
        type: string
    - name: existClient
      description: Provide existing client in list
      example: "['abc.com','xyz.com','example.com']"
      required: true
      schema:
        type: string
    - name: last_days
      description: from today to last X days
      example: "7"
      required: true
      schema:
        type: string
  - name: Get_emails
    description: Run get emails query
    parameters:
    - name: Input_data 
      description: enter the email content
      required: true
      example: "This is some text <infopercept.com> a domain that is bhagyeshp@infopercept.com"
      schema:
        type: string
    - name: Regex 
      description: write your regex
      required: false
      example: "e.g. [A-Za-z0-9]"
      schema:
        type: string

